var page_name;

VXapp = function(){
	// Dimensions and other
	var _self 		= this;
	var $window 	= $(window);
	var $winH 		= $window.outerHeight();
	var $winW 		= $window.outerWidth();
	var docHeight 	= $(document).innerHeight();
	var coolerRandom = Math.floor((Math.random() * 10) + 1) * 1000;
	var officeMaxWidth = 2550;

	// Nav and wrappers
	var body		= $("body");
	var globalNavLink = $("#global-nav a");
	var globalNav	= $("#global-nav");
	var otherNav	= $("#other-nav");
	var officeWrap	= $("#office-wrap");
	var homeBtn		= otherNav.find('.home-btn');
	var mainWrap	= $("#main-wrap");

	// Office elements
	var takeOff		= $("#take-off");
	var waterCooler = $("#water-cooler");
	var phone		= $("#phone");
	var floor		= $("#floor");
	var ceiling		= $("#ceiling");
	var wall		= $("#wall");
	var computer	= $("#computer");
	var desk		= $("#desk");
	var poster		= $("#poster");
	var video		= $("#video-bg");
	var removeOffice = $(".remove-office");

	// Section specific
	var videoGallery = $("#video-gallery");
	var playHawaiiscape = $('.play-richard-hawaiiscape');
	var socialCustom = $("#social_custom");
	var socialOptions = $(".selectboxit-container .selectboxit");

	// Prizes Page
	var partnerGallery = $("#partner-list");
	var partnerDescription = $("#partner-description");

	this.initialize = function(){

		// Run the resize function on init so video fits the page
		resizer();

		// Run the function that starts the background video
		videoStarter();

		// Set timers for office animation sequences
		coolerTimer = window.setInterval(randCoolerStart, coolerRandom);
		//phoneTimer = window.setInterval(phoneShakeStart, 2000);

		// If we aren't on the homepage, make sure the office wrap specific js doesn't interfere
		if (page_name != "home") {
			notOffice();
		} else {
			globalNav.addClass("logo-shadow");
			globalNav.addClass("nav-shadow");
			$(".icon-fb").addClass("icon-fb-shadow");
			$(".icon-tw").addClass("icon-tw-shadow");
			$(".icon-in").addClass("icon-in-shadow");
		}

		// Set a class on body for page specific styles
		body.addClass("pg-" + page_name);

		// Init select box styler
		$("select#social_options").selectBoxIt();
		$('select#airport').selectBoxIt({ autoWidth: false });

		_self.videoGalleryPopup();

	}

	this.videoGalleryPopup = function(){
		var btn = $('[data-watch]');

		for (var i = btn.length - 1; i >= 0; i--) {

			var t = $(btn[i]);
			var youtTubeId = t.attr('data-watch');

			$(btn[i]).magnificPopup({
				items: {
					src: 'https://www.youtube.com/watch?v='+youtTubeId
				},
				type: 'iframe'
			});
		};
	}


	/* --------------------------------------------------------------------------------
	RESIZER
	--------------------------------------------------------------------------------*/
	function resizer(e) {
		var $winH = $(window).height();
		var $winW = $(window).width();
	}

	$( window ).resize(function() {
		resizer();
	});

	/* --------------------------------------------------------------------------------
	RANDOMIZE WATER COOLER ANIMATION
	--------------------------------------------------------------------------------*/

	 function randCoolerStart() {
		// Play the cooler animation once every couple seconds (anywhere from 1 to 10)
		coolerRandom = Math.floor((Math.random() * 10) + 1) * 1000;
		if( waterCooler.hasClass("play-animation") ) {
			waterCooler.removeClass("play-animation");
		} else {
			waterCooler.addClass("play-animation");
		}
	}

	/* --------------------------------------------------------------------------------
	PLAY PHONE SHAKE EVERY 2 SECONDS
	--------------------------------------------------------------------------------*/

	 function phoneShakeStart() {
		// Play the phone shake animation once every 2 seconds
		if( phone.hasClass("play-animation") ) {
			phone.removeClass("play-animation");
		} else {
			phone.addClass("play-animation");
		}
	}

	/* --------------------------------------------------------------------------------
	EXIT ANIMATIONS
	--------------------------------------------------------------------------------*/

	function takeOffAnimations() {
		globalNav.removeClass("nav-shadow");
		globalNav.removeClass("logo-shadow");
		//otherNav.addClass("nav-bg");

		TweenLite.to(video, 1.5, { y:0, delay:.5, ease:Cubic.easeOut, onComplete:officeGone } );

		TweenLite.to(officeWrap, 2, { backgroundColor:"transparent", delay:0, ease:Cubic.easeOut } );
		TweenLite.to(takeOff, .3, { opacity:0, delay:0, ease:Cubic.easeOut } );

		TweenLite.to(waterCooler, 3, { x:$winW, opacity:0, delay:0, ease:Cubic.easeOut } );
		TweenLite.to(clock, 2, { x:-$winW, opacity:0, delay:.2, ease:Cubic.easeOut } );

		TweenLite.to(phone, 4, { rotation:1080, x:-$winW, y:-$winH, opacity:0, delay:.3, ease:Cubic.easeOut } );
		TweenLite.to(desk, 3, { rotation:100, x:-$winW, opacity:0, delay:.4, ease:Cubic.easeOut } );
		TweenLite.to(computer, 3, { rotation:-100, x:-$winW, opacity:0, delay:.4, ease:Cubic.easeOut } );
		TweenLite.to(poster, 3, { x:-$winW, opacity:0, delay:.4, ease:Cubic.easeOut } );

		TweenLite.to(ceiling, 2, { x:-officeMaxWidth, opacity:0, delay:.5, ease:Cubic.easeOut } );
		TweenLite.to(wall, 2, { x:officeMaxWidth, opacity:0, delay:.5, ease:Cubic.easeOut } );
		TweenLite.to(floor, 2, { x:-officeMaxWidth, opacity:0, delay:.8, ease:Cubic.easeOut } );
	}

	function notOffice() {
		globalNav.removeClass("nav-shadow");
		globalNav.removeClass("logo-shadow");
		//otherNav.addClass("nav-bg");
		mainWrap.css("z-index", "120");
		officeGone();
	}

	function officeGone(){
		body.css('overflow-y', 'auto');
		officeWrap.css('display', 'none');
		otherNav.css('background-color', 'rgba(255, 255, 255, 0.25)');
	}

	removeOffice.click(function(e) {
		e.preventDefault();

		homeBtn.removeClass('hidden');

		// Set the video wrapper up off screen so it can slide in
		TweenLite.set(video, { y:$winH } );

		takeOffAnimations();
	});

	/* --------------------------------------------------------------------------------
	ENTRY FORM
	--------------------------------------------------------------------------------*/
	socialCustom.focusin(function() {
		$(".selectboxit-container .selectboxit").css("display", "none");
		//TweenLite.to(socialOptions, 1.3, { opacity:0, ease:Cubic.easeOut } );
		//socialOptions.fadeOut();
		$(".or").fadeOut();
		TweenLite.to(socialCustom, 1.3, { width:648, delay:.5, ease:Cubic.easeOut } );
		TweenLite.to(socialCustom, 1.3, { backgroundColor:"rgba(255, 255, 255, 0.25)", delay:.5, ease:Cubic.easeOut } );
		TweenLite.to(socialCustom, .4, { fontSize:"26px", delay:1.3, ease:Cubic.easeOut } );
	});

	socialCustom.focusout(function() {
		//socialOptions.delay(1000).fadeIn();
		$(".or").delay(1000).fadeIn();
		TweenLite.to(socialCustom, .6, { width:280, delay:.3, ease:Cubic.easeOut } );
		TweenLite.to(socialCustom, 1.3, { backgroundColor:"transparent", delay:.5, ease:Cubic.easeOut, onComplete: showSelectIt } );
		TweenLite.to(socialCustom, .4, { fontSize:"14px", delay:0, ease:Cubic.easeOut } );
	});

	function showSelectIt() {
		$(".selectboxit-container .selectboxit").css("display", "block");
	}


	/* --------------------------------------------------------------------------------
	VIDEO GALLER SLIDER
	--------------------------------------------------------------------------------*/
	videoGallery.bxSlider({
		minSlides: 3,
		maxSlides: 3,
		slideWidth: 329,
		slideMargin: 23,
		pager: false,
		captions: true
	});

	/* --------------------------------------------------------------------------------
	PARTNER SLIDER
	--------------------------------------------------------------------------------*/
	var first_slide = partnerGallery.find('li:eq(1)'),
		partner_slider = partnerGallery.bxSlider({
			minSlides: 3,
			moveSlides: 1,
			maxSlides: 3,
			pager: false,
			slideWidth: 329,
			slideMargin: 23,

			onSliderLoad: function(index) {
				first_slide.addClass('active');
				partnerGallery.css('margin-left', 40); // Fix for slider being off center on inital load
			},
			onSlideBefore: function(el, previousIndex, index) {
				partnerDescription.find('p').fadeOut();
				partnerGallery.css('margin-left', 0);
			},
			onSlideAfter: function(el, previousIndex, index) {

				var 	new_slide = partner_slider.getCurrentSlideElement().next(); //(index == partner_slider.getSlideCount() - 1) ? $(el.prevObject[0]) : $(el.prevObject[index+1]);

				partnerGallery.find('.active').removeClass('active');

				partnerDescription.html( new_slide.addClass('active').find('p').clone().fadeIn() );
			}
		});

	partnerDescription.html( first_slide.find('p').clone() );

	/* --------------------------------------------------------------------------------
	INFO MODALS
	--------------------------------------------------------------------------------*/
	$('.open-modal').magnificPopup({
		type:'inline',
		midClick: true,
		mainClass: 'mfp-fade'
	});

	/* --------------------------------------------------------------------------------
	VIDEO BACKGROUNDS
	--------------------------------------------------------------------------------*/
	function videoStarter() {
		var videoName 		= "Palm_Trees_V1";
		var ext;
		var type;
		var videoFile;

		if (page_name == "hawaiiscape" ) {
			videoName = "Wave_V2";
		}

		else if (page_name == "hawaiihard") {
			videoName = "Kite_Surfer_V2";
		}

		else if (page_name == "prizes") {
			videoName = "2nd_Palm_Trees";
		}

		// Check what video type the browser supports.
		if( supports_h264_baseline_video() ){
			ext 	= '.mp4';
			type 	= 'mp4';
		}
		else if( supports_ogg_theora_video() ){
			ext 	= '.ogv';
			type 	= 'ogg';
		}
		else if( supports_webm_video() ){
			ext 	= '.webm';
			type 	= 'webm';
		}

		// Set the full path for the video
		videoFile = videoRoot + videoName + ext;

		// Get the video file, preload it, then initiate new Big Video background.
		$.get( videoFile, function(data){
			var BigVideo = new $.BigVideo({ controls: false,  doLoop: true,});
				BigVideo.init();
				BigVideo.show([	{ type: "video/" + type,  src: videoFile }	]);
				BigVideo.getPlayer().play();
		});
	}

	function supports_video() {
		return !!document.createElement('video').canPlayType;
	}

	function supports_h264_baseline_video() {
		if (!supports_video()) { return false; }
		var v = document.createElement("video");
		return v.canPlayType('video/mp4; codecs="avc1.42E01E, mp4a.40.2"');
	}

	function supports_ogg_theora_video() {
		if (!supports_video()) { return false; }
		var v = document.createElement("video");
		return v.canPlayType('video/ogg; codecs="theora, vorbis"');
	}

	function supports_webm_video() {
		if (!supports_video()) { return false; }
		var v = document.createElement("video");
		return v.canPlayType('video/webm; codecs="vp8, vorbis"');
	}

	/* --------------------------------------------------------------------------------
	RESOURCES
	--------------------------------------------------------------------------------*/
	this.isPositiveNum = function($num){
		if($num < 0){
			return false;
		}
		else{
			return true;
		}
	}

	this.isInView = function($num){
		if(Math.abs($num) <= $winH && $num <= $winH){
			return true;
		}
		else{
			return false;
		}
	}

	this.getPosition = function(element) {
		element = element.get(0);
		var xPosition = 0;
		var yPosition = 0;

		while(element) {
			xPosition += (element.offsetLeft - element.scrollLeft + element.clientLeft);
			yPosition += (element.offsetTop - element.scrollTop + element.clientTop);
			element = element.offsetParent;
		}

		return { x: xPosition, y: yPosition };
	}

	function getQueryVariable(variable) {
		var query = window.location.search.substring(1);
		var vars = query.split("&");
		for (var i=0;i<vars.length;i++) {
		       var pair = vars[i].split("=");
		       if(pair[0] == variable){return pair[1];}
		}
		return(false);
	}

	// Start Plugin
	this.initialize();
}

